package medium.repeateddnasequences;

import java.util.ArrayList;
import java.util.HashSet;
import java.util.List;
import java.util.Set;

public class Solution {

	Set<String> repeatDNAs = new HashSet<String>();
	Set<Integer> DNASet = new HashSet<>();
	
	public static void main(String[] args) {
		long start = System.currentTimeMillis();
		System.out.println(new Solution().findRepeatedDnaSequences(""));
		System.out.println(System.currentTimeMillis() - start);
	}

	public List<String> findRepeatedDnaSequences(String s) {
		char[] map = new char[26];
		map['A' - 'A'] = 0;
		map['G' - 'A'] = 1;
		map['C' - 'A'] = 2;
		map['T' - 'A'] = 3;
		for (int i = 0; i < s.length() - 9; i++) {
			String dna = s.substring(i, i+10);
			int hashCode = this.hashCodeOfDNA(dna, map);
//			System.out.println(hashCode);
			if (DNASet.contains(hashCode)) {
				repeatDNAs.add(dna);
			} else {
				DNASet.add(hashCode);
			}
		}
		
		return new ArrayList<>(repeatDNAs);
	}
	
	private int hashCodeOfDNA(String dna, char[] map) {
		int length = dna.length();
		char[] dnaChars = dna.toCharArray();
		int hash = 0;
		for (int i = 0; i < length; i++) {
			char c = dnaChars[i];
			hash = (int) (hash + map[c-'A'] * Math.pow(4, i));
//			if (c == 'A') {
//			} else if (c == 'C') {
//				hash = (int) (hash + 1 * Math.pow(4, i));
//			} else if (c == 'G') {
//				hash = (int) (hash + 2 * Math.pow(4, i));
//			} else {
//				hash = (int) (hash + 3 * Math.pow(4, i));
//			}
		}
		
		return hash;
	}

}
